import { useState } from "react"
import "../styles/Viewacademy.css"
export default function Viewacademy(){


    const [tabs, setTabs] = useState("academy")

    const tabSwitch =(event) => {
        setTabs(event.target.name)
        console.log(event.target.name)
    }

    return(
        <div>
            <div className="header">
                <div style={{fontSize:'22px'}}>Abacus Academy</div>
                <div style={{fontSize:'16px', fontWeight:'400'}}>
                    <span onClick={tabSwitch} name='academy' className="tabs" style={{border:'1px solid gray', borderRadius:'4px', padding:'8px 15px', cursor:"pointer"}}>Academy</span>
                    <span className="tabs" onClick={tabSwitch} name='course' style={{border:'1px solid gray', borderRadius:'4px', padding:'8px 15px', marginLeft:'20px', cursor:'pointer'}}>Enrolled Course</span>
                </div>
                <div style={{fontWeight:'400', fontSize:'20px'}}>Log Out</div>
            </div>

            <div>
                {tabs==='academy'?(<div>academy</div>):(<div>course</div>)}
            </div>
        </div>
    )
}
